      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "16. Bey Herrn Rudolf Kranfſtäger an der huſtſſ, ſt eine quite holländische ſtabe in bleyſt, und ſtund ſchaden a 10 Bäſen, wie auch der St. Vincent a 2 ßh. zu haben."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "17. ſo gut wie der große ſtorn von ſehen, und eine kleine weiſe ſtue zum kochen in billigen ſt zu haben, ſt in berichtſhaus ohne entgelb zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "18. Zwei Bartelinen oder Proffesor-hüſt, wie auch ein ganz neuer Calor-hut, mittlängſt Gröſſe, im Berichtshaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "19. Bey Herrn Sturbaurt aus Ricken ſt eine neue italaniſche ſtelle, halſt mit Merkträuſen mit und ohne ſtelle, ſt in billigen Preis zu haben."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "20. ſo gut ſt auch neue Bäſen in billigen Preis, im Berichtshaus ohne Entgelb zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "21. Ein Stuhl, der ab 3 Jahren Matten vorin Ricken, ſt der oberſt als ſtorchbrut. ferner 3 Stüclien von 7 Saumen vorſten voriger ſt. im Berichtshaus ohne Entgelb zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "22. Eine ſaubere fränkiſche Bether in ein Berichtshaus auf das Land oder in ein Bad dienlich, ſt in Berichtshaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "23. Eine Bewachung in der Auerſchen Vorlaſt mit 2 Stüben, ſt kannſt ſtand einer prächtigen Werkſt, ſt in einem schönen geſtoblen Keller und Garten vorſchlagen, den Jacob Wäglin dem Winmann anzumelden."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "24. Ein freund, welcher circa 600 Eſter hanſ, ſamen anbeſondere hertſen könnte, möcht aber ſoſt vorber verſt, ſt im Berichtshaus."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "25. ſo guter alter weiſſer Wein zu haben, ſt bey dem Michael Juchz dem Küſter zu perſon."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "26. Circa 6. ſtaunt extra guter alter roter Burgunder, ſt 10 ſt auf Neuland oder Burgzunder in billigen Preis im Berichtshaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "27. Ande ſtückleiſt weiſſen Weſh von 1760, ſt 8 ſt und 10 der ſaunt im einſten, und ſt 5 und 6 von anderen, ſt nach Beſtellung zu haben, im Berichtshaus ohne Entgelb zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "28. Ein ſtoff her ab 3 Jahren Matten vorin Ricken, ſt der oberſt als ſtorchbrut. ferner 2 Stüclien von 7 Saumen vorſten voriger ſt. im Berichtshaus ohne Entgelb zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "29. Ein vort Scharacken ſtamm von hoſen in billigen Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "30. Ein Orfenburger, ſt hof all St. Peter, mit Garten, ſtallung, Keller etc. wie der Augenschein zeigen wird."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "31. Ein ſauſtſickſt bei der ſteinen-Wühlin ſt 2 ſt und in billigen Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "32. Ein ſtücklein von 15 ſaumen, oder 7 ſaumen voriger ſt. im Berichtshaus ohne Entgelb zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "33. Ein beiderſte Hamburguer Strick, Wolten, ſt 5 ſt und 8 ſt, wie ſelſt ſtinnſt, ſt in Berichtshaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "34. Einen ſchlag den Siegfrieds Bewachung ins ſpieglaſſlein mit 2 Stüben, 3 Kammern etc. ſt in billigen Preis, oder samftſt zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "35. und rote Margareten, Weine von 1760, worin im billigen Preis nach Beiden zu haben, ſt im Berichtshaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "36. Ein Mannſch mit St. Peters Kueh vor dem Fenster. ſt ein grün ſoſt ſchöne Beſtellung, ſt im billigen ſt zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "37. Ein ſauſtſickſt bei der ſteinen-Wühlin ſt 2 ſt und in billigen Preis, im Berichtshaus zu erfragen."
    },
    {
      "date": "1760-01-01",
      "tags_section": "Es werden zu entleihen begehrt",
      "ntokens": null,
      "text": "38. Ein ſauſtſickſt bei der ſteinen-Wühlin ſt 2 ſt und in billigen Preis, im Berichtshaus zu erfragen."
    }
  ]
}
